import React from 'react';

const AboutPage = () => {
  return (
    <div className="about-page">
      <h1>About Jonathan Pan</h1>
      <div className="search-result">
        <h2>Jonathan Pan - LinkedIn</h2>
        <a
          href="https://www.linkedin.com/in/jonathan-pan/"
          target="_blank"
          rel="noopener noreferrer"
        >
          https://www.linkedin.com/in/jonathan-pan/
        </a>
        <p>
          Jonathan Pan is a software engineer with expertise in web development
          and front-end technologies. He has a strong passion for creating
          innovative and user-friendly applications.
        </p>
      </div>
      {/* Add more search result components if needed */}
    </div>
  );
};

export default AboutPage;
